import React from "react";
import "./Banner.scss";

function Banner() {
  return (
    <div className="banner">
      <div className="left-title">Karcher's Lab</div>
      <div className="right-nav">
        <ul>
          <li>
            <a href="#home">Home</a>
          </li>
          <li>
            <a href="#news">News</a>
          </li>
          <li>
            <a href="#contact">Contact</a>
          </li>
          <li>
            <a href="#about">About</a>
          </li>
        </ul>
      </div>
    </div>
  );
}

export default Banner;
